THE STORY BEHIND OUR  EVERY TITLE VICTORY :-

So let me tell you, he is the author behind every story of my title winning or whatever sacrifice and hurdles we have been through, i still remember the day my shoulder got injured and the whole time he  was taking care of me like a small kid,not just our workout but also preparing my diet with his own hands and always asking.after every 3 hours that "TABIYAT THIK HAINA" so i am writing this short paragraph for the best coach,Best friend ,best brother and a person behind my success or i call it our success and still we are not gonna stop here until i am gonna make his dream come true.
And doesn't matter whatever the situation will come ,i am not gonna step back and will always do everything to make you smile and proud

I lOVE YOU BROTHER🫂

